import { Navigate } from "react-router-dom";
import Home from "./Home"; // Pastikan untuk mengimpor komponen Home

function ProtectedRoute() {
  // Cek apakah ada data user di localStorage
  const isAuthenticated = localStorage.getItem("users") !== null;

  if (isAuthenticated) {
    // Jika ter-autentikasi, render komponen Home
    return <Home />;
  }

  // Jika tidak ter-autentikasi, arahkan ke halaman Sign In
  return <Navigate to="/signin" replace />;
}

export default ProtectedRoute;
